import React, { useState,useEffect } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { createTheme } from '@material-ui/core/styles';
import axios from 'axios';

import {
    Card,
    CardHeader,
    Divider,
    Grid,
    CardContent,
    CardActions,
    Chip,
    IconButton,
    CardMedia,
    Typography,
    Button,
} from '@material-ui/core';

import EditOutlinedIcon from '@material-ui/icons/EditOutlined';
import DeleteOutlineOutlinedIcon from '@material-ui/icons/DeleteOutlineOutlined';
import { gridSpacing } from '../../../../store/constant';

import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import DoneTwoToneIcon from '@material-ui/icons/DoneTwoTone';
import CloseTwoToneIcon from '@material-ui/icons/CloseTwoTone';

import Phone1 from './../../../../assets/images/widget/PHONE1.jpg';
import Phone2 from './../../../../assets/images/widget/PHONE2.jpg';
import Phone3 from './../../../../assets/images/widget/PHONE3.jpg';
import Phone4 from './../../../../assets/images/widget/PHONE4.jpg';

const useStyles = makeStyles({
    table: {
        minWidth: 250,
    },
    imgproduct: {
        width: '20px',
        height: 'auto',
    },
});

function createData(cid, itemName, photo, location, quantity, date, status, statuscolor, verify) {
    // return { cid,  itemName,photo, location, totalStock, quantity, date, stockIn, StockOut };
    return { cid, itemName, photo, location, quantity, date, status, statuscolor, verify };
}

const rows = [
    createData('#81412314', 'Item A', Phone1, '1/2', '10', '17-2-2017', '4', 'secondary'),
    createData('#68457898', 'Item B', Phone2, '2/5', '16', '20-2-2017', '5', 'primary'),
    createData('#45457898', 'Item C', Phone3, '5/3', '20', '17-2-2017', '6', 'secondary'),
    createData('#62446232', 'Item D', Phone4, '8/45', '15', '25-4-2017', '6', 'primary'),
];

export default function LatestorderCard() {
    const classes = useStyles();
    const [val, setVal] = useState(true);






    return (
        <Grid container spacing={gridSpacing}>
            <Grid item xs={11}>
                <button onClick={loadData}>click here to load datas</button>
                <Card>
                    <CardHeader
                        title={
                            <Typography component="div" className="card-header">
                                Latest Order
                            </Typography>
                        }
                    />
                    <Divider />
                    <CardContent className="p-0">
                        <TableContainer>
                            <Table className={classes.table} aria-label="simple table">
                                <TableHead>
                                    <TableRow>
                                        <TableCell>ItemID</TableCell>
                                        <TableCell>Name</TableCell>
                                        <TableCell>Photo</TableCell>
                                        <TableCell>Location</TableCell>
                                        <TableCell>Total stock</TableCell>
                                        <TableCell>Date</TableCell>
                                        <TableCell>Stock in and out</TableCell>
                                        <TableCell>Action</TableCell>
                                        <TableCell>Verify</TableCell>
                                    </TableRow>
                                </TableHead>
                                <TableBody>

                                    {rows.map((row, index) => (
                                        <TableRow key={index +1}>
                                            <TableCell>{row.cid}</TableCell>
                                            <TableCell>{row.itemName}</TableCell>
                                            <TableCell>

                                                <CardMedia
                                                    component="img"
                                                    image={row.img}
                                                    title="image"
                                                    className={classes.imglocation}
                                                />
                                            </TableCell>
                                            <TableCell>{row.location}</TableCell>
                                            <TableCell>{row.quantity}</TableCell>
                                            <TableCell>{row.date}</TableCell>
                                            <TableCell>
                                                <Chip color={row.statuscolor} label={row.status} size="small" />
                                            </TableCell>
                                            <TableCell>
                                                <IconButton color="primary">
                                                    <EditOutlinedIcon />
                                                </IconButton>
                                                <IconButton color="inherit">
                                                    <DeleteOutlineOutlinedIcon />
                                                </IconButton>
                                            </TableCell>
                                            <TableCell>
                                                <IconButton
                                                    color="inherit"
                                                    onClick={() => {
                                                        rows[index].verify = !rows[index].verify;
                                                        setVal(!val);
                                                        rows[index].verify = val;
                                                    }}
                                                >
                                                    {row.verify ? <DoneTwoToneIcon /> : <CloseTwoToneIcon />}
                                                </IconButton>
                                            </TableCell>
                                        </TableRow>
                                    ))}
                                </TableBody>
                            </Table>
                        </TableContainer>
                    </CardContent>
                    <CardActions className="f-right">
                        <a href="/widget/data">
                            <Button variant="text" size="small" color="primary">
                                View all Orders
                            </Button>
                        </a>
                    </CardActions>
                </Card>
            </Grid>
        </Grid>
    );
}
